import { memo } from "react";

const RolesIcon = memo(() => {
  return (
    <img
      className="absolute top-[183px] left-[-120px] w-[1041px] h-[805px] object-cover"
      alt="Roles"
      src="/Roles@2x.png"
    />
  );
});

export default RolesIcon;
